It’s MEET WEEK — can’t say I’m entirely stoked about competing haha I’ve probably contemplated withdrawing 100x— I’m a lot weaker post Covid, I haven’t trained for this meet at ALL, I said I wouldn’t compete as a 55kilo lifter anymore but I lost so much weight when I got sick im already pretty much at weight lmao the list GOES ON

I’ve been focusing so much on why I shouldn’t do this meet bc of X,Y,Z, that it made me realize one of the main reasons I had to take a break from weightlifting IS bc I have a tendency to ONLY focus on the negative when I weightlift.

Weightlifting is hard. Anyone in the sport will tell you. Mentally, it is one of the HARDEST sports there is. It’s extremely difficult to not get sucked into negative patterns which sometimes will put you into a lifters slump for MONTHS. We become obsessive with perfection, heavy numbers, our bodyweight, comparing ourselves to others in our weight class, if we’re good enough, and more. 

Sitting here today,  I was getting anxious knowing Saturday is the competition. After an hour of spiraling— I took a breather and wondered why am I making myself crazy with a snowball of emotions?? 

I decided—- I’m going to focus on WHY I SHOULD DO this meet. I owe it to myself to teach myself that it’s ok to not be as strong and or prepared—to feel what it is to just do something for fun and not put so much pressure on myself for “not hitting numbers” I consider to be good— to lead by example for others in the sport that struggle with that same thought of perfection, high numbers or other people who are “outlifting you”— and to remember WHY I love weightlifting. 

It’s MEET WEEK and I’m going to HAVE FUN on the platform regardless of what I hit— I’m going to smile with friends and familiar faces. Take pictures. Have a beer afterwards. Coach my athletes. And remember that the weightlifting community is there to support ALL levels and ALL athletes. 

See you Saturday ♥️🫶🏼😊
Love Always, 
The diary of a toddler sized headcase—
Heather 

